import React, {Component} from 'react';

class App extends Component {

    state = {
        books: []
    }


    render() {
        return (

            <div className="App container">
                <table>
                    <thead>
                    <tr>
                        <th>ID</th>
                        <th>Title</th>
                        <th>Rating</th>
                        <th>Actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    <tr>
                        <th>1</th>
                        <th>Book Title</th>
                        <th>2.5</th>
                        <th>
                            <button className="btn btn-default mr-1">Edit</button>

                            <button className="btn btn-danger">Delete</button>
                        </th>
                    </tr>
                    </tbody>
                </table>
            </div>
        )
            ;
    }
}

export default App;
